services:
  node.node_route_context:
    class: Drupal\suchi_custom_entity\ContextProvider\ContactTypeRouteContext
    arguments: ['@current_route_match']
    tags:
      - { name: 'context_provider' }
  contact_type:
    class: Drupal\suchi_custom_entity\ParamConverter\ContactTypeConverter
    tags:
      - { name: paramconverter }
  cors.allow_access_origin:
      class: Drupal\suchi_custom_entity\EventSubscriber\AccessOriginSubscriber
      tags:
        - {name: event_subscriber}
  page.log_simple:
        class: Drupal\suchi_custom_entity\EventSubscriber\SimpleLogger
        tags:
          - {name: event_subscriber}